import React from 'react';

export default class AddStudentForm extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            id: "",
            coachName: "",
            firstGen: false,
            race: "",
            disablility: false,
            classification: "",
            sevenTargetSchools: "",
            notifiedStudent: false,
            scholarshipMatchingComplete: false,
            scholarshipEssay: false,
            scholarshipDeadlines: "",
            scholarshipEssay3: "",
            reviewOfEssay: "",
            completedFasfsa: false,
            admissionDeadlines: "",
            rejected: false,
            waitlisted: false,
            accepted: false,
            collegePacketComplete: false,
            coachFinalReview: "",
            lor: "",
            resume: false,
            interview: false,
            award: 0
        };
    }

    onFieldChange(e, fieldName) {
        let newState = {};
        newState[fieldName] = e.target.value;
        this.setState(newState);
    }

    render() {
        return (
            <div id="newStudentForm">
                <input type="text" value={this.state.id} onChange={(e) => this.onFieldChange(e, "id")} className="studentAttribute"/>
                <input type="text" value={this.state.coachName} onChange={(e) => this.onFieldChange(e, "coachName")} className="studentAttribute"/>
                <input type="text" value={this.state.firstGen} onChange={(e) => this.onFieldChange(e, "firstGen")} className="studentAttribute"/>
            </div>
        )
    }
}
